import React from 'react'
import { Link } from 'react-router-dom'
import s from './CategoryCard.module.css'

export default function CategoryCard({el, category}) {

  return (
    <div>
        <Link to={`/categories/${category}`}>
            <div key={el} className={s.category_card}>{el}</div>

            {/* <img src=`http://localhost:3333 + {el.image}` alt='category' /> */}

        </Link>
    </div>
  )
}
